function SmallChart({variable, label, pct = false}) {
  const yMax = Math.max(...data.map(d => d[variable] / (pct ? 100 : 1)));
  return (<div style={{display: 'inline-block', padding: 10}}>
    <p style={{marginLeft: 50, fontWeight: 500}}>{label}</p>
    <XYPlot xDomain={[0, 24]} yDomain={[0, yMax]} width={309} height={120} margin={{top: 10, left: 50, bottom: 30, right: 10}}>
      <LineSeries
        data={data.map(d => ({x: d.hour + 0.5, y: d[variable] / (pct ? 100 : 1)}))} 
      />
      <XAxis tickValues={[0, 6, 12, 18, 24]} style={{fill: '#A6A5A5'}}
      />
      <YAxis style={{fill: '#A6A5A5'}}
      />
    </XYPlot>
  </div>);
}

function TinyChart({variable, label, pct = false, index = null, onNearestX, onMouseLeave}) {
  const yMax = Math.max(...data.map(d => d[variable] / (pct ? 100 : 1)));
  const seriesProps = {
    data: data.map(d => ({x: d.hour + 0.5, y: d[variable] / (pct ? 100 : 1)})) 
  };

  return (<div style={{}}>
    <p style={{fontSize: 11, marginLeft: 10, fontWeight: 400}}>{
      `${label} ${index === null ? '' : '- ' + data[index][variable] / (pct ? 100 : 1)}`
    }</p>
    <XYPlot
      onMouseLeave={onMouseLeave} 
      xDomain={[0, 24]} yDomain={[0, yMax]}
      width={194} height={60}
      margin={{top: 1, left: 10, bottom: 22, right: 10}}>
      <XAxis tickValues={[0, 6, 12, 18, 24]} style={{fontSize: 10, fill: '#A6A5A5'}}/>
      <AreaSeries {...seriesProps} color="#caf2f4"/>
      <LineSeries {...seriesProps} color="#11939A" width={2} onNearestX={onNearestX}/>
      {index === null ? null :
        <MarkSeries
          color="#12939A"
          data={[{x: index + 0.5, y: data[index][variable] / (pct ? 100 : 1)}]}
          size={3}
        />
      }
      <VerticalGridLines
        style={{stroke: "#11939A", opacity: 0.5, strokeDasharray: '2 2'}}
        tickValues={[0, 6, 12, 18, 24]}
      />
    </XYPlot></div>);
}

function MediumChart({variable, label, index = null, onNearestX, onMouseLeave}) {
  const yMax = Math.max(...data.map(d => d[variable]));
  return (<div style={{borderBottom: '1px solid #e5e5e4', paddingBottom: 16}}>
    <h2 style={{marginLeft: 0, marginTop: 4, paddingLeft: 50}}>{label}</h2>
    <XYPlot
      onMouseLeave={onMouseLeave}
      xDomain={[0, 24]}
      yDomain={[0, yMax]}
      width={659} height={120}
      margin={{top: 10, left: 50, bottom: 30, right: 10}}
    >
    <LineSeries
      onNearestX={onNearestX}
      data={data.map(d => ({
        x: d.hour + 0.5,
        y: d[variable],
        opacity: index === null || index === d.hour ? 1 : 0}))
      } 
    />
    <MarkSeries
      size={index === null ? 3 : 4}
      style={{
        fill: index === null ? 'white' : '#11939A',
        stroke: index !== null ? 'white' : '#11939A',
        strokeWidth: index === null ? 2 : 1,
        transition: 'fill 0.5s, stroke-width 0.5s'
      }}
      data={data.map(d => ({
        x: d.hour + 0.5,
        y: d[variable],
        opacity: index === null || index === d.hour ? 1 : 0}))
      }
    />
    {index === null ? null :
      <Hint value={{x: index + 0.5, y: data[index].total}} style={{background: '#494949', opacity: 0.8, padding: 10, margin: 10, fontSize: 10}}>
        <p style={{fontWeight: 500, margin: 0, color: 'white'}}>{`${index}:00 - ${index + 1}:00`}</p>
        <p style={{margin: 0, color: 'white', textAlign: 'end'}}>{`$${data[index][variable].toLocaleString()}`}</p>
      </Hint>}
      <XAxis tickValues={[0, 3, 6, 9, 12, 15, 18, 21, 24]} style={{fill: '#A6A5A5'}}
      />
      <YAxis style={{fill: '#A6A5A5'}}
      />
    </XYPlot>
  </div>);
}

